import React from 'react';
import axios from 'axios';

class PokeInfo extends React.Component{
    constructor(props){
        super(props);
        this.state={
            pokeinfo:[],
            url: this.match.props.params.url,
        };
    }

    render(){
        return(
            <div>
                <h1>PokeInfo</h1>
            <p>URL: {this.state.url} </p> 
            </div>
        );
    }
}

export default PokeInfo;
